function Info({ cepData }){



    
    return(
        <div className='dados'>
            <div>
                <p>CEP: {{cepData}.cep}</p>
                <p>CIDADE: {{cepData}.localidade}</p>
                <p>BAIRRO: {"São Jorge"}</p>
                <p>AVENIDA: {"Honorio Germano"}</p>
                <p>HORÁRIO: {"20:00H"}</p>
            </div>
        </div>
    );
}

export default Info;
